ta.remote.area[data.language]}}の{{data.remote.siteGenre[data.language]}}専門のポータルサイトです！店主の方は無料でお店の情報を登録し、お店をPRすることができます！\r\n一般の方は、{{data.remote.area[data.language]}}の{{data.remote.siteGenre[data.language]}}を探したり、お気に入りに追加、口コミ投稿、オリジナルランキングを作成したり、まとめページを作成することができます！\r\n皆さんで{{data.remote.area[data.language]}}{{data.remote.siteGenre[data.language]}}{{data.remote.settings.platform.en}}を盛り上げていきませんか？','{{data.remote.area[data.language]|uppercase}} {{data.remote.siteGenre[data.language]|uppercase}} {{data.remote.settings.platform.en}} is portal of {{data.remote.siteGenre[data.language]}} in {{data.remote.area[data.language]}}.The owners can upload their information and advertise them.The users can find {{data.remote.siteGenre[data.language]}} in {{data.remote.area[data.language]}}, add to favorite it, post review of it, make their original ranking, and collection pages.Why don\'t you liven up {{data.remote.area[data.language]|uppercase}} {{data.remote.siteGenre[data.language]|uppercase}} {{data.remote.settings.platform.en}}?'),(30,'global','global','whats_new','新着情報','What\'s New'),(31,'global','global','sub_category','サブカテゴリ','Sub Category'),(32,'global','global','station_line','路線','Lines'),(33,'global','global','area_group','エリアグループ','Area Groups'),(34,'global','global','special_conditions','こだわり条件','Special Conditions'),(35,'global','global','freeword','フリーワード','Words'),(36,'global','global','selected_condition_search','選択した条件から探す','Search by selected conditions'),(37,'global','global','cross_glue',' x ',' x '),(38,'global','global','to_symbol_glue',' 〜 ',' - '),(39,'global','global','choose_line','先に路線を選択してください。','Choose the line, first.'),(40,'global','global','choose_area_group','先にエリアグループを選択してください。','Choose the area group, first.'),(41,'index','index','search_input_placeholder','駅名や、地域、種類など','Stations, Areas, Kinds...'),(42,'station','index','narrow_down_stations_by_word','駅名で絞り込む','Narrow Down the Stations by Word'),(43,'privacy','index','privacy_content','{{data.remote.settings.our_name[data.remote.country.code][data.language]}}（「当方」又は「{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}」）は選りすぐりの情報及びその他のコンテンツをオンラインサービスにて提供いたします。これらのサービス、及び当方がいずれかのウェブサイト、デバイス又はプラットフォーム上で提供するその他の機能、ツール、アプリケーション、マテリアル又はその他のサービスは、使用するデバイス、アクセス方法の如何に関わらず｢{{data.remote.settings.platform[data.language]}}サービス｣と総称いたします。\r\n\r\n当方の最新の個人情報保護方針は下記のとおりです。本個人情報保護方針は、当方がお客様の{{data.remote.settings.platform[data.language]}}サービスのご利用に際してお客様について収集する個人情報に適用されます。また、本個人情報保護方針は、{{data.remote.settings.platform[data.language]}}サービスに必要な業務を受託した特定の第三者（「委託先」）と当方との間の情報の\r\n取扱いについても定めています。本個人情報保護方針において「個人情報」とは、特定の個人を識別することができる情報をいいます。\r\n\r\n当方の個人情報保護方針改訂版についてご質問がある場合は、{{data.remote.settings.privacy_email}}まで電子メールにてご連絡下さい。','{{data.remote.settings.our_name[data.remote.country.code][data.language]}} (“We” or “{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}”) provides an information offering a selection of many kind of places, and other content. These services, and any other features, tools, applications, materials, or other services offered by {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} on any website, device or platform are referred to collectively as the “{{data.remote.settings.platform[data.language]}} Services.”\r\n\r\nBelow you will find our updated Privacy Policy. This Privacy Policy covers the information collected about you and your activities when you use the {{data.remote.settings.platform[data.language]}} Services. It also provides information about our relationships with certain third parties that provide services in connection with the {{data.remote.settings.platform[data.language]}} Services. In this Privacy Policy, the term “personal information” means in formation which can identify the specific individual. \r\n\r\nIf you have any questions about our revised Privacy Policy, please let us know by emailing us at {{data.remote.settings.privacy_email}}'),(44,'privacy','index','information_collected_about_you','お客様について収集する情報','Information Collected About You'),(45,'privacy','index','information_collected_about_you_content','{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}は私についてどのような種類の個人情報を集めるのですか？ \r\n\r\n・お客様が当方に提供する情報(お客様の氏名、メールアドレス、生年月日、性別、電話番号及び、支払に必要となる決済情報)。\r\n・閲覧履歴など{{data.remote.settings.platform[data.language]}} サービス上でのお客様の行動に関する情報\r\n・お客様が、ご自身のFacebookアカウントと{{data.remote.settings.platform[data.language]}}アカウントを接続した場合は、お客様のFacebookアカウントからの情報（お客様の氏名、メールアドレス、生年月日、性別、コメント投稿時に表示されるFacebook アカウントのプロフィール写真\r\n＊上記以外の個人情報を収集する場合、収集する際にお客様に対して利用目的を開示し、お客様にご同意いただくことといたします。','What kinds of information does {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} collect from or about me and my activities?\r\n\r\n+ information you give us, including your name, email address, birth date, gender, phone number and other information necessary for payment;\r\n+ Your viewing history or other information on your activity on the {{data.remote.settings.platform[data.language]}} Services; and\r\n* if you connect your Facebook account with your {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} account, information from your Facebook account (your name, email address, birth date, gender, profile picture for Facebook displayed when you post any comments)\r\n* We will disclose the purpose of utilization when we collect personal information from you and obtain your consent.'),(46,'privacy','index','how_we_use_this_information','当社によるお客様の個人情報の利用方法','How We Use This Information'),(47,'privacy','index','how_we_use_this_information_content','{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}は私について収集した個人情報をどのような目的で利用するのですか？\r\n\r\n・決済情報　当方は支払に必要となる決済情報をお客様の{{data.remote.settings.platform[data.language]}}サービスの利用料等の支払の処理、及び{{data.remote.settings.platform[data.language]}}サービスの不正利用の防止を目的として利用しています。\r\n\r\n・氏名、メールアドレス、生年月日、性別、電話番号、{{data.remote.settings.platform[data.language]}} サービス上での行動　お客様と当方の関係を構築及び強化し、最上級のユーザー体験のご提供に役立てるために利用します。具体的には以下のとおりです。\r\n\r\n　・お客様へのご連絡\r\n　・お客様がご覧になるコンテンツのカスタマイズ\r\n　・お客様がご注文のサービスの提供\r\n　・当方のサービスの改善\r\n　・当方のサービスの利用の実態に関する調査の実施\r\n　・コンテンツの不正利用など違法性が疑われる行為の防止\r\n　・当方の権利の保護\r\n　・お客様に対するお薦めしたい当方の機能、サービスについての情報提供\r\n　・お客様に対する、当方の取引先のために行う{{data.remote.settings.platform[data.language]}}サービスに関連する情報の提供\r\n　・Facebookアカウントからの情報　{{data.remote.settings.platform[data.language]}}アカウントを作成するにあたり、お客様の氏名、メールアドレス、生年月日、性別を入力する手間を省くため。 {{data.remote.settings.platform[data.language]}}サービスをご利用の際にコメントを投稿するため。\r\n\r\n＊上記以外の情報については、収集する際にお客様に対して利用目的を開示いたします。\r\n','How does {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} use information it collects about me?\r\n\r\n+ Payment Information. We only use payment information, as necessary for processing payments from you and to prevent abuse of the {{data.remote.settings.platform[data.language]}} Services.\r\n\r\n+ Your Name, Email Address, Birth Date, Gender, Phone Number. We use those kinds of information we collect about you in order to establish and enhance our relationship with you and to help deliver a first-class user experience. To be concrete,\r\n\r\n  + contacting you;\r\n  + customizing the content you view;\r\n  + fulfilling your requests for services;\r\n  + improving our services;\r\n  + conducting research on how you enjoy the {{data.remote.settings.platform[data.language]}} Service;\r\n  + preventing potentially illegal activities such as unauthorized use of contents;\r\n  + protecting our rights;\r\n  + providing you with information about {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}’s features and services which we would like to recommend; and\r\n  + providing information or offers to you that are related to the {{data.remote.settings.platform[data.language]}} Services on behalf of {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}’s business partners.\r\n\r\n+ Information from your Facebook Account. We use this information in order to create your {{data.remote.settings.platform[data.language]}} account without asking you to enter your name, email address, birth date and gender, or in order to enable you to post comments when you use the {{data.remote.settings.platform[data.language]}} Service.\r\n'),(48,'privacy','index','how_we_share_this_information','第三者による個人情報の利用','How We Share This Information'),(49,'privacy','index','how_we_share_this_information_content','私についての情報を利用する{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}以外の事業者がありますか？\r\nそのような第三者は、どのような情報を何の目的で利用するのでしょうか？\r\n\r\n\r\n・サービス・プロバイダー　当方に対して決済処理サービスを提供する会社は、支払いに必要な決済情報を取り扱います。それは、{{data.remote.settings.platform[data.language]}}サービスの利用料等の支払の処理、及び{{data.remote.settings.platform[data.language]}}サービスの不正利用の防止を目的としています。\r\n\r\n・ソーシャル・ネットワーキング・サービス　お客様は、{{data.remote.settings.platform[data.language]}}サービスをFacebookなどのソーシャル・ネットワーキング・サービスと一緒に利用することができ、お客様の{{data.remote.settings.platform[data.language]}}アカウントをお客様のソーシャル・ネットワーキング・アカウントと連動させることができます。お客様の承諾を得て、\r\n当方はお客様についての情報(お客様による{{data.remote.settings.platform[data.language]}}サービスのご利用に関する情報も含まれます)をこれらのサービスに送信する場合があります。\r\n\r\n・他のウェブサイト及びプラットフォーム　{{data.remote.settings.platform[data.language]}}サービスは、他社によって運営されるインターネット上のウェブサイト又はその他のプラットフォームを通じて提供される場合があります。当方の名称又はロゴの使用についてブランド提携しているものの、このようなウェブサイト又はプラットフォ\r\nームは、当方によって運営又は管理されているわけではありません。当方は第三者によって運営されるウェブサイト又はプラットフォームにおける個人情報保護の取組みについては責任を負いません。お客様が他社のウェブサイト又はプラットフォーム上で{{data.remote.settings.platform[data.language]}}サービスをご利用になる場合は、その\r\nような他社のウェブサイト又はプラットフォームの個人情報保護方針を確認の上、お客様の個人情報がどのように取り扱われるかについてご考慮いただく必要があります。\r\n\r\n\r\n{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}は私について集めた個人情報を誰に提供していますか？\r\n\r\n上記にかかげた、サービスの提供に必要な委託先への提供を除き、当方はお客様の個人情報を第三者へ提供しておりません。\r\nただし、お客様が{{data.remote.settings.platform[data.language]}}サービス上で自主的に公開した情報（Facebookのプロフィール写真、アカウント名、コメントの内容。個人情報に該当しない場合もあります）は{{data.remote.settings.platform[data.language]}}サービスを利用する他のユーザーに対しても表示されます。','With whom does {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} share the information it collects about me?\r\nFor what purpose does that person/entity use what information?\r\n\r\n\r\nService Providers. A company which provides us payment service handles information necessary for payment for the purpose of processing payments and preventing any abuse of the {{data.remote.settings.platform[data.language]}} Services.\r\n\r\nSocial Networking Services. You can connect your {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} account with your Facebook account. With your consent, {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} may send information about you to Facebook.\r\n\r\nOther Websites and Platforms. The {{data.remote.settings.platform[data.language]}} Services may be provided through Internet websites or other platforms operated by other companies. Websites and platforms like these may be co-branded with our name or logo, but they are not operated or maintained by us, and we are not responsible for the privacy practices of the websites or platforms operated by third parties. If you are using the {{data.remote.settings.platform[data.language]}} Services on another website or platform, you should check the privacy policy of the other website or platform to determine how it handles your personal information.'),(50,'privacy','index','your_choices','お客様の選択肢','Your Choices'),(51,'privacy','index','your_choices_content','{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}が私について収集した情報をどのように利用するかについて、私が選択することはできますか？\r\n\r\n設定のページを訪問することにより、お客様は当方からのサービスを宣伝するメールを当方から受信することを拒否することができます。ただし、お客様の選択の如何に関わらず、当方は管理用メッセージ、サービス情報、お客様のアカウントの利用条件又はこれらに類する電子メール等を、受信拒否\r\nするための機会をお客様に提供することなく、お客様に送付することがあります。お客様のアカウントが終了した後も、お知らせの受信拒否を設定しない限り、お知らせは送信され、また当方はお客様に関する個人情報の一部を留保する場合がありますのでご了承下さい。','Do I have choices about {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}’s use and sharing of the information it collects from or about me?\r\n\r\nBy visiting the Settings page, you may opt out of receiving email updates from {{data.remote.settings.platform[data.language]}} promoting our services. Regardless of your choices with respect to promotional communications and updates regarding content, we may send you administrative messages, service announcements, terms and conditions of your account, or other similar communications, without offering you the opportunity to opt out of receiving them. Please note that, even after you terminate your account, you will receive emails from {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} unless you opt out, and we may retain some information about you.'),(52,'privacy','index','security_etc','セキュリティ等','Security, etc.'),(53,'privacy','index','security_etc_content','{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}は私について収集した情報をどのように保護するのですか？\r\n\r\n\r\n当方は、その保有する個人情報を、紛失、窃取及び無断使用、無断開示又は無断改変から保護するため、物理的、技術的及び管理上合理的な手段を利用しています。例えば、パスワード及びその他の機密情報は、暗号化されて送信されます。また、当方は、お客様の個人情報へのアクセスにつき適法な\r\n業務上の理由のある当方の従業員、代理人及び請負業者のみがアクセス権を有することを確保するための措置も講じています。\r\n\r\nお客様が機密情報を入力するにあたっては、当方は、課金する際の業界における標準的通信手段である、セキュア・ソケット・レイヤー(secure sockets layer、SSL)技術を利用して当該情報を暗号化しています。\r\n\r\n上記の取組みはあるものの、いかなる情報の送信又は保管も、100％安全である旨の保証はいたしかねますのでご了承下さい。当方は、お客様が安心して{{data.remote.settings.platform[data.language]}}サービスをご利用いただけるよう尽力いたしますが、お客様が当方に送信される情報の安全性を保証することはできません。\r\n\r\n\r\n{{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}}が個人情報保護方針を変更した場合はどうなりますか？\r\n\r\n\r\n当方は、業界における取り組み、法律、{{data.remote.settings.platform[data.language]}}サービスの対象範囲の変更に従うなどの理由により、随時、本個人情報保護方針を変更する場合があります。従って、最新の個人情報保護方針及びその運用をお客様に確実にご理解いただくためには、お客様が{{data.remote.settings.platform[data.language]}}サイトにアクセスされる度又は{{data.remote.settings.platform[data.language]}}\r\nサービスをご利用になる度に当サイトに掲載されている個人情報保護方針の効力発生日をご確認いただくことが必要です。当方が本個人情報保護方針について重大な改訂を行った場合、当方は当該改訂の効力発生前に、{{data.remote.settings.platform[data.language]}}サイトにその旨のご案内を掲載いたします。かかる重大な改訂が、お客様の個人情報の使用又は開示に際してお客様の同意を得る旨の表明していた事項に関連する場合、当方は、当該表明事項に矛盾した取扱いを行うことのないよう、お客様の同意を得るようにいたします。','How does {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} protect the information it collects from or about me?\r\n\r\n\r\nWe use reasonable physical, technical, and administrative measures to safeguard personal information in our possession against loss, theft and unauthorized use, disclosure, or modification. For example, passwords and other sensitive information are encrypted in transit. We also take steps to ensure that only those {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} employees, agents, and contractors who have a legitimate business reason to obtain access to your personal information are granted access.\r\n\r\nWhen you enter sensitive information, we encrypt that information using secure sockets layer technology (SSL), an industry standard protocol for billing transmission.\r\n\r\nDespite the efforts above, please note that no data transmission or storage can be guaranteed to be 100% secure. We want you to feel confident using the {{data.remote.settings.platform[data.language]}} Services but we cannot ensure or warrant the security of any information you transmit to us.\r\n\r\n\r\nWhat happens when {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} changes its Privacy Policy?\r\n\r\n\r\nFrom time to time, we may revise this Privacy Policy to reflect industry initiatives or changes in the law or changes to the scope of the {{data.remote.settings.platform[data.language]}} Services or for other reasons. Therefore, it is important to check the effective date of the Privacy Policy posted at this website each time you visit this website or use any of the {{data.remote.settings.platform[data.language]}} Services to ensure you are familiar with the most updated policies and practices. If we make any material revisions to this Privacy Policy, we will notify you by posting notice on the {{data.remote.settings.platform[data.language]}} Site. If the material revisions concern practices where we have represented that we will obtain your consent to use or disclose your personally identifiable information, we will obtain your consent before taking any action inconsistent with those representations.'),(54,'privacy','index','for_your_information_other_tech','＜ご参考＞　クッキー、ウェブビーコン及びその他の技術','<For Your Information> Cookies, Web Beacons, and Other Technologies'),(55,'privacy','index','for_your_information_other_tech_content','{{data.remote.settings.platform[data.language]}}サービスの利用状況を把握するためにどのような技術が使用されているのですか？\r\n\r\n当方は{{data.remote.settings.platform[data.language]}}サービス上で、{{data.remote.settings.platform[data.language]}}サービス及びインターネットがどのように利用されているかをよりよく把握するために、様々な技術を利用しています。そのような技術は個人情報を収集するものではありませんが、以下、ご参考までにどのように作用するかについて説明いたします。\r\n\r\n・クッキー　クッキーは、お客様のコンピューターのインターネットブラウザー内の個別ファイルに保存されている、情報の細かい断片です。ウェブサイトのお客様の行動の情報は、クッキーによって保存されます。例えば、お客様が以前訪問したウェブサイト又はその他のプラットフォームに簡単に\r\nサインインできるよう、お客様のセッション情報をクッキーで保存することができます。お客様はクッキーによって{{data.remote.settings.platform[data.language]}}サービスをより楽しくご利用いただけるのです。\r\n\r\n　・例えば、当方は、ターゲット広告を表示することがありますが、それは、クッキーに保存された、当方のウェブサイトを訪問したという情報に基づいています。\r\n　・また、当方は、お客様の{{data.remote.settings.platform[data.language]}}サービスのご利用を、お客様又は定評ある第三者から得た情報に関連づけるために、及び統合情報を編集するために、クッキー及びこれに類似する技術を利用することもあります。\r\n　・クッキーが送信される度に警告するか、クッキーを完全に拒否するかの設定をインターネットブラウザー上で行うことはできますが、{{data.remote.settings.platform[data.language]}}サービスにログインするにはクッキーが必要です。\r\n\r\n・その他のローカル・ストーレージ　当方は、{{data.remote.settings.platform[data.language]}}サービス(ビデオプレーヤーを含みます)に関連して、ローカル・シェアード・オブジェクト(Local Shared Objects)(｢フラッシュ・クッキー｣と呼ばれる場合があります。) 及びHTML5ローカル・ストーレージ、その他の種類のローカル・ストーレージを利用しています。｢ブラウザー・クッキー｣と呼ばれることもあるこれらの技術は、お客様のコンピューター内に保存され、お客様の行動や、例えばお客様の設定等のお客様の嗜好に関する一定の情報を保存するために利用することができるという点において、上記のクッキーと似ています。但し、\r\nこれらのオブジェクトは、通常のブラウザー・クッキーからお客様のコンピューター内の異なる場所に保存されます。インターネットブラウザーの多くは、お客様が、ブラウザー・コントロールを使用して、HTML5ローカル・ストーレージを無効にするか、又は、HTMLローカル・ストーレージ内の情報>を削除することができるようになっています。ローカル・シェアード・オブジェクト内の情報を無効とするか又は削除したい場合には、インターネットブラウザーの設定から行ってください。なお、これらの技術を無効化すると、当サービスの性能及び機能を妨げることがあります。\r\n\r\n・ウェブビーコン　当方は、お客様のインターネットブラウザーからウェブサーバーに情報を伝達する技術を利用する場合があります。これらの技術には、いわゆる｢ピクセルタグ｣、｢ウェブビーコン｣、｢クリアGIF｣又はこれらに類似する方法(以下総称して｢ピクセルタグ等｣といいます)が含まれます>\r\n。ピクセルタグはウェブページ、ビデオ又は電子メールに組み込むことによって、ウェブサーバーがお客様のブラウザーから特定の種類の情報を認識することができるようにし、お客様が特定のウェブページ又は電子メールのメッセージを閲覧したか否かを確認することができます。当方は、お客様のユーザー体験を向上させることを目的としてピクセルタグ等を利用しています。','What technologies are used to understand how people use the {{data.remote.settings.platform[data.language]}} Services?\r\n\r\nOn {{data.remote.settings.platform[data.language]}} Services, we use a variety of technologies to learn more about how people use the {{data.remote.settings.platform[data.language]}} Services and the Internet. Although such technologies do not collect any personal information, just for your information, this section provides explanation on how they work.\r\n\r\n\r\n+ Cookies. Cookies are small bits of information that are stored in separate files within your computer’s Internet browser. Cookies store information about your activities on a website. For example, cookies can store your session information for easy sign-in to a website or other platform you have previously visited. They enable us to make your use of the {{data.remote.settings.platform[data.language]}} Services more enjoyable.\r\n  \r\n  + For example, we may display targeted advertisements based on the information stored in cookies that you have visited our website.\r\n  + We may also use cookies and similar technologies to relate your use of the {{data.remote.settings.platform[data.language]}} Services to information we obtain from you or from reputable third parties, and to compile aggregate information.\r\n  + You can configure your Internet browser to warn you each time a cookie is being sent or to refuse cookies completely. However, cookies are necessary when you log into {{data.remote.settings.platform[data.language]}} Services.\r\n\r\n+ Other local storage. We use other kinds of local storage, such as Local Shared Objects (also referred to as “Flash cookies”) and HTML5 local storage, in connection with the {{data.remote.settings.platform[data.language]}} Services. Sometimes called “browser cookies,” these technologies are similar to the cookies discussed above in that they are stored on your computer and can be used to store certain information about your activities and preferences, such as your settings. However, these objects are stored in different parts of your computer from ordinary browser cookies. Many Internet browsers allow you to disable HTML5 local storage or delete information contained in HTML5 local storage using browser controls. If you would like to disable or delete information contained in Local Shared Objects, please go to the settings of your Internet browser. Please note that disabling these technologies may interfere with the performance and features of our services.\r\n\r\n+ Web beacons. We may use technologies that communicate information from your Internet browser to a web server, including so-called “pixel tags,” “web beacons”, “clear GIFs”, or similar means (collectively, “Pixel Tags”). Pixel Tags, which can be embedded in web pages, videos, or emails, can allow a web server to read certain types of information from your browser, check whether you have viewed a particular web page or email message. We use Pixel Tags to improve your {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} experience.'),(56,'global','global','questions','ご質問','Questions'),(57,'privacy','index','privacy_question_content','本個人情報保護方針について疑問がある場合には、誰に連絡すればよいですか？ \r\n\r\nお客様に、本個人情報保護方針に関する疑問がある場合(当方がお客様についての不正確な情報を有しているかもしれないとお客様がお考えになる場合を含みます)、お客様は、{{data.remote.settings.privacy_email}}宛に、電子メールを送ることができます。\r\n\r\n\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}}\r\nTEL：{{data.remote.settings.our_tel[data.remote.country.code]}}\r\n\r\n\r\n{{data.remote.settings.privacy_email}}のメールアドレスは、当方の個人情報保護方針に関するお客様とのご連絡を目的に限定して使用されるものです。お客様において、{{data.remote.settings.platform[data.language]}}サービスに関する一般的なご質問がある場合、{{data.remote.settings.platform[data.language]}}サイトの｢お問い合わせ｣のページを通じて、当方までご連絡下さい。','Who can I contact if I have concerns about this Privacy Policy?\r\n\r\nIf you have concerns regarding this Privacy Policy, including if you believe that {{data.remote.settings.our_abbreviation[data.remote.country.code][data.language]}} may have incorrect information for you, you may email us at {{data.remote.settings.privacy_email}}. You may also contact us by mail:\r\n\r\n\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}}\r\nTEL: {{data.remote.settings.our_tel[data.remote.country.code]}}\r\n\r\n\r\nThe {{data.remote.setting.privacy_email}} email address is used only for communications about our Privacy Policy. If you have general questions about the {{data.remote.settings.platform[data.language]}} Services, please contact us through the Contact Us page on {{data.remote.settings.platform[data.language]}} Site.'),(58,'terms','index','description_of_terms_of_use','1. サービス内容及び利用規約の承諾','1. DESCRIPTION OF SERVICE AND ACCEPTANCE OF TERMS OF USE'),(59,'terms','index','description_of_terms_of_use_content','{{data.remote.settings.our_name[data.remote.country.code][data.language]}}(以下｢当方｣といいます)は選りすぐりの情報及びその他のコンテンツ(以下｢本コンテンツ｣と総称します)をオンラインサービスにて提供いたします。当方の情報、本コンテンツ、及び当方がその事業に関連して随時提供するその他の機能、ツール、アプリケーション、マテリアル又は その他のサービスは、アクセス方法の如何に関わらず、｢{{data.remote.settings.platform[data.language]}}サービス｣と総称いたします。\r\n\r\n本コンテンツは、以下の i 及び ii (以下｢本プロパティ｣と総称いたします)を通じて利用することができます。\r\n\r\n i. autham.netのウェブサイト(以下｢{{data.remote.settings.platform[data.language]}}サイト｣といいます)\r\nii. 当方が許可したアプリケーション、機能又は装置\r\n\r\n本プロパティ上での{{data.remote.settings.platform[data.language]}}サービスの利用(本コンテンツへのアクセスを含みます)は、この利用規約(以下｢本利用規約｣といいます)、及び、当方の申込書、機能又は装置に添付されるエンドユーザー・ライセンス契約の遵守を条件とします。\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスは、有料サービスに加入していただいた場合に全ての機能をご利用いただけますが、当方は、{{data.remote.settings.platform[data.language]}}サービスのうち特定の機能につきお客様に 無償で提供させていただきます。また、当方 は、特定の本コンテンツを閲覧するためのアクセス権を無償で提供させていただきます。\r\n{{data.remote.settings.platform[data.language]}}サービスへの加入及び料金に関するご案内は、下記第4条に記載されています。\r\n\r\n当方は、本利用規約に従い、お客様お一人お一人にお楽しみいただける{{data.remote.settings.platform[data.language]}}サービスの提供に努めさせていただきます。お客様が{{data.remote.settings.platform[data.language]}}サービスに アクセスして{{data.remote.settings.platform[data.language]}}サービスをお楽しみいただくためには、本利用規約に定める諸条件にご同意いただき、これらを遵守していただくことが必要となります。 {{data.remote.settings.platform[data.language]}}サイトをご訪問いただくか又は{{data.remote.settings.platform[data.language]}}サービスをご利用いただいた場合(本コンテンツへのアクセスを含みます)、お客様は本利用規約に同意された こととなります。少々お時間をいただきまして、本利用規約に注意深く目を通していただきますようお願いいたします。当方はお客様に最上級のユーザー体験を ご提供することを目指しております。本利用規約に関してご質問又はご意見がございましたら、{{data.remote.settings.legal_email}}又は本書の末尾に記載 の住所若しくは電話番号宛にご連絡下さい。','{{data.remote.settings.our_name[data.remote.country.code][data.language]}} (“{{data.remote.settings.platform[data.language]}}”, “we” or “us”) provides an online service offering a selection of information, and other content (collectively, the “Content”). Our service, the Content and any other features, tools, applications, materials, or other services offered from time to time by {{data.remote.settings.platform[data.language]}} in connection with its business, however accessed, are referred to collectively as the “{{data.remote.settings.platform[data.language]}} Services.”\r\n\r\nThe Content is available for permissible using or through the following (collectively, the “Properties”):\r\n\r\n i. the autham.net website (the “{{data.remote.settings.platform[data.language]}} Site”); and\r\nii. {{data.remote.settings.platform[data.language]}} authorized applications, features or devices.\r\n\r\nUse of the {{data.remote.settings.platform[data.language]}} Services (including access to the Content) on the Properties is subject to compliance with these Terms of Use (“Terms of Use” or “Terms”) and any end user license agreement that might accompany a {{data.remote.settings.platform[data.language]}} application, feature or device.\r\n\r\nThe all features of {{data.remote.settings.platform[data.language]}} Services are available on a paid-subscription-only basis, although we may make limited features of the {{data.remote.settings.platform[data.language]}} Services available to you free-of-charge. And we provide access to view certain Content free-of-charge. Information pertaining to subscriptions and fees is provided in Section 4, below.\r\n\r\nIt is our pleasure to provide the {{data.remote.settings.platform[data.language]}} Services for your personal enjoyment and entertainment in accordance with these Terms of Use. To access and enjoy the {{data.remote.settings.platform[data.language]}} Services, you must agree to, and follow, the terms and conditions set forth in these Terms of Use. By visiting the {{data.remote.settings.platform[data.language]}} Site or using any of the {{data.remote.settings.platform[data.language]}} Services (including accessing any Content) you are agreeing to these Terms. Please take a moment to carefully read through these Terms. It is our goal to provide you with a first class user experience, so if you have any questions or comments about these Terms, please contact us at: {{data.remote.settings.legal_email}} or at the address or telephone number at the end of this document.'),(60,'terms','index','changes_to_the_terms_of_use','2. 当方による本利用規約の変更','2. CHANGES TO THE TERMS OF USE BY {{data.remote.settings.platform[data.language]}}'),(61,'terms','index','changes_to_the_terms_of_use_content','当方は変更した本利用規約を{{data.remote.settings.platform[data.language]}}サイトautham.netに掲載することにより、本利用規約を随時変更することができます。当方が本利用規約について重大な変更を行った場合は、当方は{{data.remote.settings.platform[data.language]}}サイト上に変更に関するお知らせを掲載してお客様にお知らせします。本利用規約に関する重大な変更 は、当初の掲載から30日後に自動的に効力を生じます。なお、かかる30日の期間中に登録されたお客様又はその他の方法で別途ご同意いただいたお客様につきましては、それぞれご登録又はご同意いただいた時点で効力を生じます。','{{data.remote.settings.platform[data.language]}} may amend these Terms of Use at any time by posting the amended Terms of Use on the {{data.remote.settings.platform[data.language]}} Site at autham.net. If we make a material amendment to these Terms of Use, we will notify you by posting notice of the amendment on the {{data.remote.settings.platform[data.language]}} Site. Any material amendment to these Terms of Use shall be effective automatically 30 days after it is initially posted or, for users who register or otherwise provide opt-in consent during this 30 day period, at the time of registration or consent, as applicable.\r\n'),(62,'terms','index','access_and_use_of_the_service','3. {{data.remote.settings.platform[data.language]}}サービスへのアクセス及び利用','3. ACCESS AND USE OF THE {{data.remote.settings.platform[data.language]}} SERVICES'),(63,'terms','index','access_and_use_of_the_service_content','年齢制限\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスは、未成年者が、その親権者や未成年後見人の関与・承諾なしで利用することを想定しておりません。お客様が13歳未満の場合は、 {{data.remote.settings.platform[data.language]}}サービスにご加入いただいたり、個人情報を当方へご提供いただいたりすることはできません。お客様が13歳以上20歳未満の場合は、親権者又は未成年後見人の同意がある場合に限り、{{data.remote.settings.platform[data.language]}}サービスにご加入いただくことができます。\r\n\r\nお客様のライセンス\r\n\r\n当方はお客様に対し、お客様が利用料をお支払いただきかつ本利用規約を遵守していただくことを条件として、本プロパティ上で{{data.remote.settings.platform[data.language]}}サービスを利用するための非独占的な限定的ライセンスを付与させていただきます。かかるライセンスには、本利用規約に定めるお客様の営業目的での本コンテンツへの情報の掲載が含まれます。\r\n\r\n本コンテンツ\r\n\r\nお客様は、本利用規約に従って営業目的での本コンテンツへの情報の掲載が可能です。お客様は、直接か又は何らかの装置、ソフ トウェア、インターネットサイト、ウェブ上で利用できるサービス若しくはその他の手段を通じてかに関わらず、本コンテンツに付された著作権、商標又はその他の所有権に関する表示あるいは本コンテンツに関するデジタル著作権管理メカニズム、装置又はその他のコンテンツ保護若しくはアクセス制御のための手段 (ジオフィルタリング・メカニズムを含みます)を削除、変更、迂回、無効化、妨害又は回避することはできません。お客様は、直接か、又は、何らかの装置、 ソフトウェア、インターネットサイト、ウェブ上で利用できるサービス、若しくはその他の手段を通じてかに関わらず、当方が書面で明示的に許可した場合を除き、本コンテンツをコピー、ダウンロード、ストリームキャプチャ、複製、複写、アーカイブ保管、配信、アップロード、公開、変更、翻訳、実行、表示、販売、送信又は再送信することはできません。お客様は、当方が書面で明示的に許可した場合を除き、本コンテンツをいずれかのハードウェア若しくはソフトウェア用アプリケーションに組み込んだり、又はかかるハードウェア若しくはソフトウェア用アプリケーションによって本コンテンツを再送信したりしてはならず、また、フレーム又はインラインリンクによって本コンテンツの利用を可能にすることはできません。かかる制限事項の対象となる本コンテンツには、テキスト、グラフィックス、レイアウト、インター フェース、ロゴ、写真、録音・録画資料及びスチール写真が含まれますがこれに限定されません。また、当方が書面で明示的に許可した場合を除き、お客様が本コンテンツの二次的著作物又は別途何らかの点で本コンテンツに由来するか若しくは本コンテンツをベースとするマテリアル(モンタージュ、マッシュアップ、壁紙、デスクトップテーマ、グリーティングカード及び商品を含みます)を作成することは厳禁とします。かかる禁止規定は、お客様が二次的著作物であるマテリアルの無償提供を予定されている場合においても適用されます。\r\n\r\n所有権\r\n\r\nお客様は、{{data.remote.settings.platform[data.language]}}サービスに関するすべての権利を当方が所有ないし留保していることにつき同意するものとします。また、お客様は、{{data.remote.settings.platform[data.language]}}サービスにおいてお客様がアクセス及び閲覧、掲載する本コンテンツは、当方及び当方のライセンサーによって所有又は管理されていることにつき同意するものとします。 {{data.remote.settings.platform[data.language]}}サービス及び本コンテンツは、著作権法、商標法及びその他の知的財産関連法によって保護されています。\r\n\r\nお客様の責任事項\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスをすべての皆様に安全にご利用いただくためには、お客様、その他のユーザーの皆様及び当方が同一の｢交通規則｣に従う必要があります。お客様及びその他のユーザーの皆様には適法、かつ適切な目的に限定して{{data.remote.settings.platform[data.language]}}サービスをご利用いただきますようお願い申し上げます。本原則を お守りいただくことは非常に重要です。お客様は、{{data.remote.settings.platform[data.language]}}サービス、本コンテンツに関する上記の制限事項を遵守していただくことに同意し、また、下記のいずれかを伴う態様で{{data.remote.settings.platform[data.language]}}サイトにアクセスし又は{{data.remote.settings.platform[data.language]}}サービスを利用しないことにつき同意するものとします。\r\n\r\n・第三者の権利(特許、商標、営業秘密、著作権、プライバシー、パブリシティ、肖像権その他の所有権又は人格権を含む)を侵害すること。\r\n・{{data.remote.settings.platform[data.language]}}サービス(本コンテンツを含みます)にアクセスし、当方によって許可されていない技術又はその他の手段を利用すること({{data.remote.settings.platform[data.language]}}サービスの不正なダウンロード、複製、アクセス又 は配信の防止を目的とするコンテンツ保護又はアクセスコントロールのためのメカニズムを削除、無効化、迂回又は回避することを含みます)。\r\n・｢ロボット｣、｢スパイダー｣又は｢オフラインリーダー｣を含む自動化された手段によって{{data.remote.settings.platform[data.language]}}サービス(本コンテ