ta.remote.country.code][data.language]}}を当方に支払うことに予め同意するものとします。\r\n\r\nダウンロード\r\n\r\n特定の{{data.remote.settings.platform[data.language]}}サービスへのご加入、又は特定の本コンテンツへのアクセスに際しては、ソフトウェア若しくはその他のマテリアルのダウンロード又は追加の諸条件への同意が必要であるとお知らせする場合がございます。かかる追加の諸条件において別途定める場合を除き、かかる追加の諸条件は、本条項をもっ て、本利用規約に組み込まれるものとします。\r\n\r\n停止/中止\r\n\r\n当方は、勿論そうすることを望んではおりませんが、いずれか又はすべてのユーザーの皆様に関して、いつ何時にても通知を要さずに、{{data.remote.settings.platform[data.language]}}サービス (本コンテンツ及び{{data.remote.settings.platform[data.language]}}サービスへのアクセスに使用される装置を含みます)の一部又は全部を、一時的又は永続的に変更、停止又は中止する場合がありま す。お客様は、当方が、単独の裁量において、かかる措置を講じることができることを了解します。また、お客様は、{{data.remote.settings.platform[data.language]}}サービスの変更、停止又は中止に つき、当方がお客様に対して責任を負わないことに同意するものとします。当方は、単独の裁量において、下記第4条に従い、お客様に対して、クレジットの提供、返金、割引又はその他の方式による対価の提供をすることができるものとします(例えば、当方は、追加の日数分のサービス利用クレジットをお客様のアカウントに提供することができます)。しかしながら、当方が本利用規約に対するお客様の違反を理由としてお客様のアカウントを終了するか、又は{{data.remote.settings.platform[data.language]}}サー ビスへのお客様のアクセスを停止若しくは中止する場合は、お客様はかかるクレジット、返金、割引又はその他の対価を受領することはできません。\r\n\r\nインターネット利用料\r\n\r\nインターネットへのアクセスに関してお客様に発生する一切の費用についてはお客様のご負担といたします。\r\n','Age Limitations.\r\n\r\nThe {{data.remote.settings.platform[data.language]}} Services are not intended to be used by children without involvement and approval of a parent or guardian. If you are under the age of 13, you are not permitted to register with {{data.remote.settings.platform[data.language]}} or provide your personal information to {{data.remote.settings.platform[data.language]}}. If you are at least 13 and under 20 years of age, you may register with {{data.remote.settings.platform[data.language]}} only if you have the consent of your parent or guardian.\r\n\r\nYour License.\r\n\r\nSubject to your payment of the subscription fees and compliance with these Terms, {{data.remote.settings.platform[data.language]}} is pleased to grant you a non-exclusive limited license to use the {{data.remote.settings.platform[data.language]}} Services on the Properties, including uploading your Content, for commercial purpo