e search engines for the sole purpose of, and solely to the extent necessary for, creating publicly available search indices - but not caches or archives - of the {{data.remote.settings.platform[data.language]}} Services and excluding those search engines or indices that host, promote, or link primarily to infringing or unauthorized content);\r\n+ introduces viruses or any other computer code, files, or programs that interrupt, destroy, or limit the functionality of any computer software or hardware or telecommunications equipment;\r\n+ damages, disables, overburdens, impairs, or gains unauthorized access to the {{data.remote.settings.platform[data.language]}} Services, including {{data.remote.settings.platform[data.language]}}’s servers, computer network, or user accounts;\r\n+ removes, modifies, disables, blocks, obscures or otherwise impairs any advertising in connection with the {{data.remote.settings.platform[data.language]}} Services (including the Content);\r\n+ uses the {{data.remote.settings.platform[data.language]}} Services to advertise or promote services that are not expressly approved in advance in writing by {{data.remote.settings.platform[data.language]}};\r\n+ collects personally identifiable information in violation of {{data.remote.settings.platform[data.language]}}’s Privacy Policy;\r\n+ encourages conduct that would constitute a criminal offense or give rise to civil liability;\r\n+ violates these Terms or any guidelines or policies posted by {{data.remote.settings.platform[data.language]}};\r\n+ interferes with any other party’s use and enjoyment of the {{data.remote.settings.platform[data.language]}} Services; or\r\n+ attempts to do any of the foregoing.\r\n\r\nIf {{data.remote.settings.platform[data.language]}} determines in its sole discretion that you are violating any of these Terms, we may\r\n\r\n i. notify you, and\r\nii. use technical measures to block or restrict your access or use of the {{data.remote.settings.platform[data.language]}} Services. In either case, you agree to immediately stop accessing or using in any way (or attempting to access or use) the {{data.remote.settings.platform[data.language]}} Services, and you agree not to circumvent, avoid, or bypass such restrictions, or otherwise restore or attempt to restore such access or use.\r\n\r\nNo Spam/Unsolicited Communications.\r\n\r\nWe know how annoying and upsetting it can be to receive unwanted email or instant messages from people you do not know. Therefore, no one may use the {{data.remote.settings.platform[data.language]}} Services to harvest information about users for the purpose of sending, or to facilitate or encourage the sending of, unsolicited bulk or other communications. You understand that we may take any technical remedies to prevent spam or unsolicited bulk or other communications from entering, utilizing, or remaining within our computer or communications networks. If you Post (as defined below in Section 7) or otherwise send spam, advertising, or other unsolicited communications of any kind through the {{data.remote.settings.platform[data.language]}} Services, you acknowledge that you will have caused substantial harm to {{data.remote.settings.platform[data.language]}} and that the amount of such harm would be extremely difficult to measure. As a reasonable estimation of such harm, you agree to pay {{data.remote.settings.platform[data.language]}} {{data.remote.settings.spam_payment_price[data.remote.country.code][data.language]}} for each such unsolicited communication you send through the {{data.remote.settings.platform[data.language]}} Services.\r\n\r\nDownloads.\r\n\r\nIn order to participate in certain {{data.remote.settings.platform[data.language]}} Services or access certain Content, you may be notified that it is necessary to download software or other materials or agree to additional terms and conditions. Unless otherwise provided by these additional terms and conditions, they are hereby incorporated into these Terms.\r\nSuspension/Discontinuation.\r\n\r\nWe hope not to, but we may change, suspend, or discontinue (temporarily or permanently) some or all of the {{data.remote.settings.platform[data.language]}} Services (including the Content and the devices through which the {{data.remote.settings.platform[data.language]}} Services are accessed), with respect to any or all users, at any time without notice. You acknowledge that {{data.remote.settings.platform[data.language]}} may do so in {{data.remote.settings.platform[data.language]}}’s sole discretion. You also agree that {{data.remote.settings.platform[data.language]}} will not be liable to you for any modification, suspension, or discontinuance of the {{data.remote.settings.platform[data.language]}} Services, although {{data.remote.settings.platform[data.language]}} may, in its sole discretion, provide you with a credit, refund, discount or other form of consideration (for example, we may credit additional days of service to your account) in accordance with Section 4 below. However, if {{data.remote.settings.platform[data.language]}} terminates your account or suspends or discontinues your access to {{data.remote.settings.platform[data.language]}} Services due to your violation of these Terms, then you will not be eligible for any such credit, refund, discount or other consideration.\r\n\r\nInternet Access Charges.\r\n\r\nYou are responsible for any costs you incur to access the internet.'),(64,'terms','index','subscriptions_and_billing','4. 加入及び料金請求','4. SUBSCRIPTIONS AND BILLING'),(65,'terms','index','subscriptions_and_billing_content','{{data.remote.settings.platform[data.language]}}サービスで提供する本コンテンツの全ての機能をご利用いただくためには利用料のお支払が必要となります。\r\nお客様は、お客様のアカウントをクリックいただくことで、いつ何時にても、{{data.remote.settings.platform[data.language]}}サービスへの加入状況に関する詳細をご覧いただけます。また、お客様はコンテンツのライセンサーによる制約及び第三者によるその他の制限又は留意 事項等の理由により、いずれかの本プロパティでアクセス可能な特定の本コンテンツが他の本プロパティではアクセスできない場合があることに同意するものと します。\r\n本利用規約において、｢1日｣は{{data.remote.country[data.language]}}標準時の午前零時に始まり、同じ暦日の{{data.remote.country[data.language]}}標準時の午後11時59分に終わるものとします。\r\n\r\n料金請求\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスへの加入をお申込みいただくことにより、お客様は、月額利用料、追加サービスに関するその他の料金(お客様が購入された場合)及び お客様による{{data.remote.settings.platform[data.language]}}サービスのご利用に関連して適用される各種税金（以下「月額利用料等」と総称します）を、登録手続においてお客様から申し出があり、 当方によって承諾されたクレジットカード又はその他の支払方法(以下｢本支払方法｣といいます)により、当方がお客様に対して請求する権限が付与されることに明示的にご同意いただいたことになります。\r\n本支払方法の利用にあたって、お客様は、ご指定のクレジットカードの発行会社の会員規約その他の本支払方法に関連するサービス規約の定めるところに従うこととします。\r\n\r\n本利用規約において、｢料金請求｣とは、お客様の本支払方法に対して請求又は引き落としをさせていただくことを意味します。利用料は、ポイントを都度購入の際に料金請求させていただきます。お客様の次回の更新期間開始日につきましてはお客様のアカウントページの料金請求に関する情報欄をご覧下さい。\r\n販売促進用割引、お客様の加入プランの変更及び適用される税金の変更により、請求金額が毎月異なることがあること、並びに、かかる金額をお客様の本支払方法に請求することにつき、お客様は当方に対し予め承諾するものとします。当方が{{data.remote.settings.platform[data.language]}}サービスの利用料又はその他の手数料を随時変更 する場合、当方は、これらの変更につき{{data.remote.settings.platform[data.language]}}サイトにて事前にお客様に通知いたします。但し、当方は、適用される税金の変更についてはお客様に通知しな いことができるものとします。\r\nすべての料金及び手数料は返金できません。非常に希に、特別な事情がある場合で、当方が適当であると判断した場合(例えば、{{data.remote.settings.platform[data.language]}}サービスが技術 的問題により何日も利用できなかった場合等)、当方は、影響を受けた加入者に対してクレジットを提供することがあります。かかるクレジットの金額及び形式、並びにそれらの提供の決定は、当方の単独かつ絶対的裁量によるものであり、ある場合にクレジットの提供があったとしても、将来、同様又は異なる状況に おいてクレジットを受ける権利が付与されるというわけではありません。\r\n\r\n継続加入及びキャンセル\r\n\r\nお客様の{{data.remote.settings.platform[data.language]}}サービスへの加入は、お客様が加入をキャンセルされるまで、又はアカウント若しくはサービスが本利用規約に従い別途停止若しくは中止されるまで、1ヶ月毎に有効に継続されます。お客様が加入をキャンセルした場合は返金いたしませんが、当該月の残りの期間中は継続して{{data.remote.settings.platform[data.language]}}サービスのすべての機能を利用することができます。お客様のアカウントのキャンセル方法に関しましては、下記第5条をご参照下さ い。\r\n\r\n未払金額\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスの維持のためには、{{data.remote.settings.platform[data.language]}}サービスのユーザーの皆様お一人お一人がご同意いただいた支払義務を遵守していただく必要がございま す。従いまして、当方は、{{data.remote.settings.platform[data.language]}}サービスに関してお客様にお支払いただけなかった金額を回収する権利を保持するものとします。お客様は支払い義務のある すべての金額、及び当該金額の回収に関連して当方に発生したすべての費用(回収代行業者の手数料、合理的範囲の弁護士報酬及び仲裁若しくは訴訟の費用を含 みますがこれらに限定されません)に関して当方に責任を負うこととなります。\r\n\r\nフリートライアル\r\n\r\n当方は特定の条件を満たすユーザーの皆様に対してフリートライアル(無料お試し)による{{data.remote.settings.platform[data.language]}}サービスのご提供をさせていただく場合がございま す。当方がフリートライアルをご提供する場合は、お客様のフリートライアルに関する具体的な条件はかかる特定のフリートライアルについてご説明するマーケ ティング資料に記載されます。当方はフリートライアルとその他の特典とをセットにして提供することはできません。お客様のフリートライアル(もしあれば) に関する詳細については、お客様のアカウントをクリックしてご確認下さい。\r\n\r\n当方は、お客様のフリートライアルによる加入が終了した旨、又は、お客様の有料での加入が開始した旨の通知はいたしませんので、この点を十分にご理 解いただきますようお願い申し上げます。お客様は下記第5条に記載の要領に従ってお客様のアカウント及び加入をキャンセルすることができます。{{data.remote.settings.platform[data.language]}}サービスへの加入が第三者の 製品又はサービスの購入又は代金支払と併せて提供される場合は、お客様は、かかる第三者の製品又はサービスの購入又は使用に起因又は関連して生じる一切の請求に関し、当方がお客様に対して責任を負わないことに合意するものとします。\r\n','Use all features in the {{data.remote.settings.platform[data.language]}} Services requires payment by you of a subscription fee.\r\nYou can find the specific details regarding your subscription to {{data.remote.settings.platform[data.language]}} Services at any time by clicking on Your Account. Additionally, you agree that for various reasons, such as restrictions from content licensors and other limitations or considerations from third parties, certain Content that may be accessible through one Property may not be accessible through other Properties.\r\nFor consistency, a “day” for purposes of these Terms of Use begins at 12:00 a.m. {{data.remote.country[data.language]}} Standard Time and ends at 11:59 p.m. {{data.remote.country[data.language]}} Standard Time of that same calendar day.\r\n\r\nBilling.\r\n\r\nBy signing up for your {{data.remote.settings.platform[data.language]}} Services subscription, you are expressly agreeing that we are authorized to charge you a monthly subscription fee, any other fees for additional services you may purchase, and any applicable taxes in connection with your use of the {{data.remote.settings.platform[data.language]}} Services(collectively “Monthly Subscription Fee, etc.”) to the credit card or other payment method accepted by {{data.remote.settings.platform[data.language]}} (“Payment Method”) that you provided.\r\nWhen you use your Payment Method, you agree the terms and conditions set by your credit card issuing company.\r\n\r\nAs used in these Terms of Use, “billing” shall indicate either a charge or debit, as applicable, against your Payment Method. The subscription fee will be billed at the purchasing the Points. To see the commencement date for your next renewal period, go to the billing information section on Your Account page.\r\nYou acknowledge that the amount billed each month may vary due to promotional offers, changes in your subscription plan, and changes in applicable taxes, and you authorize us to charge your Payment Method for the corresponding amounts. If {{data.remote.settings.platform[data.language]}} changes the subscription fee or other charges for the {{data.remote.settings.platform[data.language]}} Services from time to time, we will post advance notice of these changes on the {{data.remote.settings.platform[data.language]}} Site. However, we will not be able to notify you of changes in any applicable taxes.\r\nAll fees and charges are nonrefundable. Very rarely, if there are special circumstances where {{data.remote.settings.platform[data.language]}} determines it is appropriate (e.g., the {{data.remote.settings.platform[data.language]}} Services are unavailable for days due to technical difficulties), we may provide credits to affected subscribers. The amount and form of such credits, and the decision to provide them, are at {{data.remote.settings.platform[data.language]}}’s sole and absolute discretion, and the provision of credits in one instance does not entitle anyone to credits in the future under similar or different circumstances.\r\n\r\nOngoing Subscription and Cancellation.\r\n\r\nYour {{data.remote.settings.platform[data.language]}} Services subscription will continue in effect on a month-to-month basis unless and until you cancel your subscription, or until the account or service is otherwise suspended or discontinued pursuant to these Terms. If you cancel your subscription during a given month, you will not receive a refund but you will continue to have use all features of the {{data.remote.settings.platform[data.language]}} Services for the remainder of that month. For instructions on how to cancel your account, please see Section 5, below.\r\n\r\nUnpaid Amounts.\r\n\r\nIn order to sustain the {{data.remote.settings.platform[data.language]}} Services, it is important that each user of the {{data.remote.settings.platform[data.language]}} Services honor the payment obligations to which the user agreed. Accordingly, we reserve the right to pursue any amounts you fail to pay in connection with the {{data.remote.settings.platform[data.language]}} Services. You will remain liable to {{data.remote.settings.platform[data.language]}} for all such amounts and all costs we incur in connection with the collection of these amounts, including, without limitation, collection agency fees, reasonable attorneys’ fees, and arbitration or court costs.\r\n\r\nFree Trials.\r\n\r\nOn occasion, we may be authorized to offer the use of the {{data.remote.settings.platform[data.language]}} Services through free trials for certain qualifying users. If we offer you a free trial, the specific terms of your free trial will be stated in the marketing material describing the particular free trial. We are unable to accommodate combining free trials with any other offers. To view the specific details regarding your free trial, if any, click on Your Account.\r\n\r\nIt is very important to understand that you will not receive a notice from {{data.remote.settings.platform[data.language]}} that your free trial subscription has ended. You can cancel your account and your subscription by following the instructions provided in Section 5, below. To the extent {{data.remote.settings.platform[data.language]}} Services subscriptions are offered in conjunction with purchases of, or payment for, third party products or services, you agree that {{data.remote.settings.platform[data.language]}} will not be liable to you for any claims arising out of or related to your purchase or use of such third party products or services.\r\n'),(66,'terms','index','subscriber_accounts','5. 加入者アカウント','5. SUBSCRIBER ACCOUNTS'),(67,'terms','index','subscriber_accounts_content','{{data.remote.settings.platform[data.language]}}サービスの全ての機能を利用していただくためには、当方にアカウントを開設していただくことが必要となります。\r\nお客様は、ご家族による利用等、お客様のアカウントのあらゆる利用について責任を負います。お客様がご自身以外の方によるお客様のアカウントへのアクセスを許した場合、お客様は利用者として本利用規約を遵守させる責任を負うと同時に、利用者の{{data.remote.settings.platform[data.language]}}サービス上での行為について責任を負うことに同意したものとみなされます。\r\nお客様にご提出いただくすべてのアカウント情報は正確かつ最新のものでなければなりません。お客様のパスワードは秘密情報としてお取り扱いいただきますようお願い申し上げます。当方の代理人等に対してお客様のパスワードを開示いただく必要はありません。お客様のアカウントの使用(第三者による不正使 用を含みます)はすべてお客様の責任となりますので、お客様のパスワードのセキュリティ保護に十分ご注意下さい。お客様のアカウントが不正使用されたことが判明した場合、又は不正使用の疑いがある場合は、お問い合わせフォームにご記入いただくことにより直ちに当方までお知らせ下さい。お客様のアカウント情報に変更があった場合は、当方がお客様にご連絡する際に支障のないよう、必ず当方までお知らせ下さい。\r\nお客様は、お客様のアカウントに行き、｢登録のキャンセル｣オプションを選択することにより、お客様のアカウントを終了することができます。当方が お客様のアカウントを終了するために追加情報を提出するようお願いした場合には、お客様のアカウントを明記のうえ、有効な返信用電子メールアドレスをお知らせ下さい。\r\n当方は、お客様が本利用規約に違反し、法令・規則に違反し、若しくはその他の不適切な行為を行ったと当方の単独の裁量により判断した場合、又はその他の業務上の理由に基づき、お客様のアカウント又はお客様による{{data.remote.settings.platform[data.language]}}サービスの利用若しくは本コンテンツへのアクセスを、通知をすることなく又は責任を負うことなく、何時にても直ちに解除又は制限する権利を留保するものとします。当方はまた、お客様による利用が、当方のネットワーク又はサーバーに不当な負担をかけた場合、お客様のアカウント又はお客様による{{data.remote.settings.platform[data.language]}}サービスの利用若しくは本コンテンツへのアクセスを終了させる権利を留保するものとします。さりながら、かかる終了を可能な限り回避することが望ましいことから、当方は、当方のサーバーに対して行われるコール数又は掲示されるユーザー・マテ リアル(第7条において定義されます)の容量等を制限する技術を使用することがあります。お客様は、これらの制限に従い、それらを回避、無効化、又は迂回するためのいかなる手段も講じないことに同意することとします。\r\n','In order to use all features of the {{data.remote.settings.platform[data.language]}} Services, you will be required to create an account with {{data.remote.settings.platform[data.language]}}.\r\nYou are responsible for all use of your account, including use of your account by other members of your household. By allowing others to access your account, you agree to be responsible for ensuring that they comply with these Terms of Use and you agree to be responsible for their use of the {{data.remote.settings.platform[data.language]}} Services.\r\nAll account information you submit must be accurate and updated. Please keep your password confidential. You will not have to reveal it to any {{data.remote.settings.platform[data.language]}} representative. You are responsible for all use on your account, including unauthorized use by any third party, so please be very careful to guard the security of your password. Please notify us by using our contract form and completing the form as soon as you know of, or suspect any unauthorized use of, your account. Please also make sure to notify us if your account information changes, in case we need to contact you.\r\nYou may terminate your account by going to Your Account page, and choosing the “delete my account” option. Please identify your account and provide a valid reply email address in the event we require additional information to terminate your account.\r\nWe reserve the right to immediately terminate or restrict your account or your use of the {{data.remote.settings.platform[data.language]}} Services or access to Content at any time, without notice or liability, if {{data.remote.settings.platform[data.language]}} determines in its sole discretion that you have breached these Terms of Use, violated any law, rule, or regulation, engaged in other inappropriate conduct, or for any other business reason. We also reserve the right to terminate your account or your use of the {{data.remote.settings.platform[data.language]}} Services or access to Content if such use places an undue burden on our networks or servers. Of course, we would prefer to avoid such termination; therefore, we may use technology to limit activities, such as the number of calls to the {{data.remote.settings.platform[data.language]}} servers being made or the volume of User Material (as defined below in Section 7) being Posted, and you agree to respect these limitations and not take any steps to circumvent, avoid, or bypass them.\r\n'),(68,'terms','index','collection_and_use_of_personal_information','6. 個人情報の収集及び使用','6. COLLECTION AND USE OF PERSONAL INFORMATION'),(69,'terms','index','collection_and_use_of_personal_information_content','お客様の個人情報の収集及び使用に関する当方の方針及び取り組みにつきましては、このサイトに掲載されている当方の個人情報保護方針をお読み下さい。本個人情報保護方針はご参照いただくことにより本利用規約に組み込まれ、本利用規約の一部を構成し ます。従いまして、本利用規約に同意することにより、お客様は、{{data.remote.settings.platform[data.language]}}サイトにおけるお客様のプレゼンス及び本プロパティ上での{{data.remote.settings.platform[data.language]}}サービスの利用 につき、お客様のご利用時点において有効な当方の個人情報保護方針の適用を受けることについても同意するものとします。\r\n','For information about {{data.remote.settings.platform[data.language]}}’s policies and practices regarding the collection and use of your personally identifiable information, please read {{data.remote.settings.platform[data.language]}}’s Privacy Policy located in this website. The Privacy Policy is incorporated by reference and made part of these Terms of Use. Thus, by agreeing to these Terms of Use, you agree that your presence on the {{data.remote.settings.platform[data.language]}} Site and use of the {{data.remote.settings.platform[data.language]}} Services on any of the Properties are governed by the {{data.remote.settings.platform[data.language]}} Privacy Policy in effect at the time of your use.\r\n'),(70,'terms','index','use_reviews_comments_and_other_material','7. ユーザーの皆様のレビュー、コメント及びその他のマテリアル','7. USER REVIEWS, COMMENTS, AND OTHER MATERIAL'),(71,'terms','index','use_reviews_comments_and_other_material_content','お客様による投稿\r\n\r\n{{data.remote.settings.platform[data.language]}}サービスの一つとして、ユーザーの皆様は、レビュー、コメント又はその他のマテリアル(以下｢ユーザー・マテリアル｣と総称します)を公開、送信、提出又はその他の方法で投稿する(以下｢投稿する｣と総称します)機会を有する場合があります。{{data.remote.settings.platform[data.language]}}サービスが当方のすべてのユーザーの皆様にとって楽しいものであり続けるためには、お客様に下記の規則を守っていただかなければなりません。\r\nお客様が投稿するユーザー・マテリアルを注意深くお選び下さい。{{data.remote.settings.platform[data.language]}}サービスに直接関連するユーザー・マテリアルに限定するようにして下さい。 また、以下のいずれかに該当するユーザー・マテリアルを投稿することを禁止いたします。 (当方の裁量において)違法であるか、権利侵害にあたるか、性的、猥褻的、中傷的、誹謗的若しくは脅迫的であるか、嫌がらせにあたるか、低俗、下品、不敬、不愉快、人種差別的若しくは民族差別的であるか、犯罪行為を助長し、民事責任を生じさせ、若しくは法令若しくは規則に違反するものであるか、知的財産権を含む第三者の権利を侵害するものであるか、又は別途不適切であるか若しくは当方に好ましくないもの、 権利侵害にあたるコンテンツ又は不正なコンテンツにリンクしているもの、あるいは 不適切に他者になりすますもの。当方はお客様のフルネームをお客様のユーザーIDとして使用しておりますので、お客様の投稿の都度、お客様のフルネームが 公開されることになります。 お客様のメールアドレス、電話番号又は所在地等の追加的な個人情報は投稿しないことをお勧めしますが、かかる情報を投稿される場合は十分ご注意下さい。\r\nお客様が、ユーザー・マテリアルを投稿することによってかかるマテリアルに関する所有権を当方に譲渡させられることはありません。お客様のユー ザー・マテリアルの投稿後も、お客様は投稿前に有していた所有権と同一の所有権をすべて保有し続けます。お客様のユーザー・マテリアルを投稿することにより、お客様は当方に対し、本プロパティの利用による場合を含め、{{data.remote.settings.platform[data.language]}}サービスを通じて、当該ユーザー・マテリアルを既知の又は今後創出される何らかの メディア形式及びメディア経路により、世界各国で永久的に使用、表示、複製、配信及び修正し、当該ユーザー・マテリアルから削除し、当該ユーザー・マテリ アルに追加し、当該ユーザー・マテリアルの二次的著作物を作成し、また、当該ユーザー・マテリアルを公衆向けに実施しかつ公開するための限定的ライセンス を付与するものとします。このライセンスは非独占的であり(すなわち、お客様が当方以外の者に対してお客様のユーザー・マテリアルのライセンスを付与することは自由であることを意味します)、全額支払済であり、ロイヤルティの負担がなく(すなわち、お客様のユーザー・マテリアルの使用に関して当方からお客様への支払は不要であることを意味します)、かつサブライセンスの付与が可能です(よって当方は{{data.remote.settings.platform[data.language]}}サービスを提供する際に当方の関連会社、下請業者及びインターネットコンテンツ配信ネットワーク等のその他のパートナーに対しユーザー・マテリアルを使用させることができます)。また、お客様はユー ザー・マテリアルを投稿することによって、{{data.remote.settings.platform[data.language]}}サービスの他のユーザーに対し、{{data.remote.settings.platform[data.language]}}サービスの機能を通じて、かつ、本利用規約に基づいて許可されるところに従って当該ユーザー・マテリアルにアクセスし、これを使用、表示、複製、配信及び実施するための非独占的な限定的ライセンスを付与します。\r\n\r\n第三者による投稿\r\n\r\n上記の制限事項に拘わらず、ユーザーの皆様によって提供されるマテリアルの中には異議の対象となり得る、違法、不正確又は不適切なマテリアルが存在する場合のあることをご承知おき下さい。当方はいかなるユーザー・マテリアルも推奨するものではなく、投稿されたユーザー・マテリアルは当方の意見又は方針を反映するものではありません。当方は、ユーザー・マテリアルを監視し、当方が当方の裁量により不適切であると判断した場合又はその他の業務上の理由によりユーザー・マテリアルを制限又は削除する権利を留保しますが、かかる義務を負うものではありません。当方はいかなる場合においてもユーザー・マテリアルについてその如何に関わらず何らの義務又は責任も負うものではなく、お客様はかかるユーザー・マテリアルに関してお客様が当方に対し有することのある一切の制定法上又は衡平法上の権利又は救済を放棄することに同意します。お客様が不適切なユーザー・マテリアルを発見された場合は当方までお知らせいただけますと大変ありがたく存じます。不適切なユーザー・マテリアルに該当する個別の事例につきまして{{data.remote.settings.platform[data.language]}}サービスの｢報告する｣機能がご利用いただけない 場合は、{{data.remote.settings.support_email}}までメール(件名：｢不適切なユーザー・マテリアル｣)でご連絡下さい。\r\n','Your Posts.\r\n\r\nAs part of the {{data.remote.settings.platform[data.language]}} Services, users may have an opportunity to publish, transmit, submit, or otherwise post (collectively, “Post”) reviews, comments, or other materials (collectively, “User Material”). In order to keep the {{data.remote.settings.platform[data.language]}} Services enjoyable for all of our users, you must adhere to the rules below.\r\nPlease choose carefully the User Material that you Post. Please limit yourself to User Material directly relevant to the {{data.remote.settings.platform[data.language]}} Services. Moreover, you must not Post User Material that:\r\n\r\n + is unlawful, infringing, pornographic, obscene, defamatory, libelous, threatening, harassing, vulgar, indecent, profane, hateful, racially or ethnically offensive, encourages criminal conduct, gives rise to civil liability, violates any law, rule, or regulation, infringes any right of any third party including intellectual property rights, or is otherwise inappropriate or objectionable to {{data.remote.settings.platform[data.language]}} (in {{data.remote.settings.platform[data.language]}}’s sole discretion);\r\n + links to infringing or unauthorized content; or\r\n + improperly claims the identity of another person.\r\n\r\nPlease note that we use your first and last name as your user ID and therefore your first and last name will appear to the public each time you Post. We advise that you do not, and you should also be careful if you decide to, Post additional personally identifiable information, such as your email address, telephone number, or street address.\r\nYou must be, or have first obtained permission from, the rightful owner of any User Material you Post. By submitting User Material, you represent and warrant that you own the User Material or otherwise have the right to grant {{data.remote.settings.platform[data.language]}} the license provided below. You also represent and warrant that the Posting of your User Material does not violate any right of any party, including privacy rights, publicity rights, and intellectual property rights. In addition, you agree to pay for all royalties, fees, and other payments owed to any party by reason of your Posting User Material. {{data.remote.settings.platform[data.language]}} will remove all User Material if we are properly notified that such User Material infringes on another person’s rights. You acknowledge that {{data.remote.settings.platform[data.language]}} does not guarantee any confidentiality with respect to any User Material.\r\nBy Posting User Material, you are not forfeiting any ownership rights in such material to {{data.remote.settings.platform[data.language]}}. After Posting your User Material, you continue to retain all of the same ownership rights you had prior to Posting. By Posting your User Material, you grant {{data.remote.settings.platform[data.language]}} a limited license to use, display, reproduce, distribute, modify, delete from, add to, prepare derivative works of, publicly perform, and publish such User Material through the {{data.remote.settings.platform[data.language]}} Services worldwide, including on or through any Property, in perpetuity, in any media formats and any media channels now known or hereinafter created. The license you grant to {{data.remote.settings.platform[data.language]}} is non-exclusive (meaning you are not prohibited by us from licensing your User Material to anyone else in addition to {{data.remote.settings.platform[data.language]}}), fully-paid, royalty-free (meaning that {{data.remote.settings.platform[data.language]}} is not required to pay you for the use of your User Material), and sublicensable (so that {{data.remote.settings.platform[data.language]}} is able to use its affiliates, subcontractors, and other partners, such as internet content delivery networks, to provide the {{data.remote.settings.platform[data.language]}} Services). By Posting your User Material, you also hereby grant each user of the {{data.remote.settings.platform[data.language]}} Services a non-exclusive, limited license to access your User Material, and to use, display, reproduce, distribute, and perform such User Material as permitted through the functionality of the {{data.remote.settings.platform[data.language]}} Services and under these Terms of Use.\r\n\r\nThird Party Posts.\r\n\r\nDespite these restrictions, please be aware that some material provided by users may be objectionable, unlawful, inaccurate, or inappropriate. {{data.remote.settings.platform[data.language]}} does not endorse any User Material, and User Material that is Posted does not reflect the opinions or policies of {{data.remote.settings.platform[data.language]}}. We reserve the right, but have no obligation, to monitor User Material and to restrict or remove User Material that we determine, in our sole discretion, is inappropriate or for any other business reason. In no event does {{data.remote.settings.platform[data.language]}} assume any responsibility or liability whatsoever for any User Material, and you agree to waive any legal or equitable rights or remedies you may have against {{data.remote.settings.platform[data.language]}} with respect to such User Material. You can help us tremendously by notifying us of any inappropriate User Material you find. If a “report” feature through the {{data.remote.settings.platform[data.language]}} Services is not available for a specific instance of inappropriate User Material, please email {{data.remote.settings.support_email}} (subject line: “Inappropriate User Material”).\r\n'),(72,'terms','index','disclaimer_of_warranties_limitation_of_liability_and_indemnity','8. 保証の放棄、責任及び補償の制限','8. DISCLAIMER OF WARRANTIES, LIMITATION OF LIABILITY AND INDEMNITY'),(73,'terms','index','disclaimer_of_warranties_limitation_of_liability_and_indemnity_content','当方は{{data.remote.s