tings.platform[data.language]}}側当事者がこれを被らぬよう補償することに同意するものとします。当方は、お客様による補償に依拠することとは別に、当方の費用負担により、お客様の弁護士と異なる弁護士を依頼し、独占的な防御権を行使し事案を処理する権利を留保します。\r\n','WHILE WE DO OUR BEST TO PROVIDE THE OPTIMAL PERFORMANCE OF THE {{data.remote.settings.platform[data.language]}} SERVICES, YOU AGREE THAT USE OF THE {{data.remote.settings.platform[data.language]}} SERVICES IS AT YOUR OWN RISK. THE {{data.remote.settings.platform[data.language]}} SERVICES, INCLUDING THE {{data.remote.settings.platform[data.language]}} SITE AND THE OTHER PROPERTIES, THE CONTENT, USER MATERIAL, AND ANY OTHER MATERIALS CONTAINED ON OR PROVIDED THROUGH THE PROPERTIES, ARE PROVIDED “AS IS” AND, TO THE FULLEST EXTENT PERMITTED BY LAW, ARE PROVIDED WITHOUT WARRANTIES OF ANY KIND, EITHER EXPRESS OR IMPLIED. WITHOUT LIMITING THE FOREGOING, AND TO THE FULLEST EXTENT PERMITTED BY LAW, {{data.remote.settings.platform[data.language]}} DOES NOT MAKE ANY WARRANTIES OF FITNESS FOR A PARTICULAR PURPOSE, TITLE, MERCHANTABILITY, COMPLETENESS, AVAILABILITY, SECURITY, COMPATIBILITY OR NONINFRINGEMENT; OR THAT THE {{data.remote.settings.platform[data.language]}} SERVICES WILL BE UNINTERRUPTED, FREE OF VIRUSES AND OTHER HARMFUL COMPONENTS, ACCURATE, ERROR FREE, OR RELIABLE.\r\nTO THE FULLEST EXTENT PERMITTED BY LAW, IN NO EVENT SHALL {{data.remote.settings.platform[data.language]}} OR ITS AFFILIATES, SUCCESSORS, AND ASSIGNS, AND EACH OF THEIR RESPECTIVE INVESTORS, DIRECTORS, OFFICERS, EMPLOYEES, AGENTS, AND SUPPLIERS (INCLUDING DISTRIBUTORS AND CONTENT LICENSORS) (COLLECTIVELY, THE “{{data.remote.settings.platform[data.language]}} PARTIES”), BE LIABLE FOR ANY DIRECT, INDIRECT, PUNITIVE, INCIDENTAL, SPECIAL, CONSEQUENTIAL, OR OTHER DAMAGES, INCLUDING LOSS OF PROFITS, ARISING OUT OF OR IN ANY WAY RELATED TO THE USE OF THE {{data.remote.settings.platform[data.language]}} SERVICES (INCLUDING ANY INFORMATION, PRODUCTS, OR SERVICES ADVERTISED IN, OBTAINED ON, OR PROVIDED THROUGH THE PROPERTIES), WHETHER BASED IN CONTRACT, TORT, STRICT LIABILITY, OR OTHER THEORY, EVEN IF THE {{data.remote.settings.platform[data.language]}} PARTIES HAVE BEEN ADVISED OF THE POSSIBILITY OF DAMAGES; PROVIDED, HOWEVER, THAT TO THE EXTENT THESE TERMS OF USE ARE SUBJECT TO THE CONSUMER CONTRACT ACT, THE FOREGOING LIMITATION OF LIABILITY SHALL NOT APPLY WITH RESPECT TO DAMAGES ARISING OUT OF ANY {{data.remote.settings.platform[data.language]}} PARTY’S GROSS NEGLIGENCE OR INTENTIONAL MISCONDUCT. CERTAIN LAWS (SUCH AS THE CONSUMER CONTRACT ACT) MAY NOT ALLOW LIMITATIONS ON IMPLIED WARRANTIES OR THE EXCLUSION OR LIMITATION OF CERTAIN DAMAGES. IF THESE LAWS APPLY TO YOU, SOME OR ALL OF THE ABOVE DISCLAIMERS, EXCLUSIONS, OR LIMITATIONS MAY NOT APPLY TO YOU. IN NO EVENT SHALL OUR TOTAL LIABILITY TO YOU FOR ALL DAMAGES, LOSSES AND CAUSES OF ACTION WHETHER IN CONTRACT, TORT (INCLUDING NEGLIGENCE) OR OTHERWISE EXCEED THE AMOUNT PAID BY YOU TO US, IF ANY, FOR ACCESSING OR PARTICIPATING IN ANY ACTIVITY RELATED TO USE OF THE {{data.remote.settings.platform[data.language]}} SERVICE OR {{data.remote.settings.spam_payment_price[data.remote.country.code][data.language]}} (WHICHEVER IS LESS).\r\nTO THE FULLEST EXTENT PERMITTED BY LAW, YOU AGREE TO DEFEND, INDEMNIFY, AND HOLD HARMLESS THE {{data.remote.settings.platform[data.language]}} PARTIES FROM AND AGAINST ANY AND ALL LIABILITIES, CLAIMS, DAMAGES, EXPENSES (INCLUDING REASONABLE ATTORNEYS’ FEES AND COSTS), AND OTHER LOSSES ARISING OUT OF OR IN ANY WAY RELATED TO YOUR BREACH OR ALLEGED BREACH OF THESE TERMS OR YOUR USE OF THE {{data.remote.settings.platform[data.language]}} SERVICES (INCLUDING YOUR USE OF THE CONTENT). {{data.remote.settings.platform[data.language]}} RESERVES THE RIGHT, AT OUR OWN EXPENSE, TO EMPLOY SEPARATE COUNSEL AND ASSUME THE EXCLUSIVE DEFENSE AND CONTROL OF ANY MATTER OTHERWISE SUBJECT TO INDEMNIFICATION BY YOU.\r\n'),(74,'terms','index','terms_general_information','9. 一般条項','9. GENERAL INFORMATION'),(75,'terms','index','terms_general_information_content','準拠法及び管轄\r\n\r\n本利用規約は日本法に準拠し、これに従い解釈されます。お客様が当方に対して請求を行う場合、又は、当方がお客様に対して請求を行う場合、お客様は、東京地方裁判所の専属的管轄権に服することに同意します。\r\n\r\n権利放棄の否認/依拠の禁止\r\n\r\nお客様が他者による本利用規約の違反に気付かれた場合は{{data.remote.settings.legal_email}}宛に、当方までお知らせ下さい(件名：｢利用規約違 反｣)。本利用規約の違反者に対する当方の対応につきましては、個別の事例のすべての事実関係及び事情を注意深く分析した後に具体的な内容を決定することとなります。とある者、又はとある状況に関して当方が行った個別具体的な対応をもって、別の者又は別の事情に関して当方が行い得る行為等を示すものとしてこれに依拠することはできません(たとえ、双方の当事者及び状況がお客様から見て類似したものであったとしても、です)。同様に、当方が本利用規約の違反に関して対応しなかった場合であっても、お客様は当方が当該違反に抗議しなかったとみなすことはもちろん、当方がかかる違反を知っていたとみなすこともできません。また、とある者に関して本利用規約のいずれかの規定に係る権利を放棄した場合であっても当該当事者又はその他の当事者に関してかかる規定(又は その他の規定)に係る権利を放棄したものと解釈することはできません。また、当方が本利用規約に基づく権利又は救済の行使又は執行を直ちに行わないと判断した場合であっても、かかる権利又は救済に関して権利放棄したことにはなりません。お客様から見て本利用規約と相容れない行為を当方が行った場合であっても、当方の行為を本利用規約に係る権利放棄又は解釈上の変更とみなすことはできません。\r\n\r\n完全なる合意、修正及び分離独立性\r\n\r\n本利用規約(本利用規約に組み込まれる当方の個人情報保護方針、並びに当方の許可するアプリケーション、機能及び装置に添付されるエンドユーザーラ イセンス契約を含みます)はお客様と当方との間の完全なる法的合意を構成するものであり、お客様による{{data.remote.settings.platform[data.language]}}サービスの利用(お客様による本コンテンツ の利用を含みます) (但し、当方が別途署名済の書面による合意に基づきお客様に提供することのあるサービス(もしあれば)を除きます)に適用されるものであって、{{data.remote.settings.platform[data.language]}} サービスに関するお客様と当方との間の一切の従前の合意に完全に取って代わるものです。上記第2条に定める場合を除き、本利用規約は、当方によって署名された書面による場合を除き、これを修正又は変更することはできません。今日においては電子署名又はデジタル署名を従来の手書きによる署名と同等のものとみなすことが普及してきていることは当方も了解していますが、上記の目的において、署名又は｢署名された｣文書若しくは合意書には電子署名又はデジタル署名は含まれないものとします。本利用規約は法律の許容する範囲において最大限適用されるものとします。本利用規約のいずれかの規定が違法、無効又は執行不能と判断された場合は、お客様及び当方は、かかる規定は本利用規約から分離して扱うことが可能であるものとし、その余の規定の効力及び執行可能性には影響しないことに合意するものとします。\r\n\r\n連絡先に関する情報\r\n\r\n本利用規約に関するご質問又はご意見、あるいはお客様の加入に関するご質問がございましたら、当方のカスタマーサービス部門の下記の連絡先までご連絡下さい。\r\n\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_tel[data.remote.country.code]}}\r\n\r\n本利用規約をお読み頂きありがとうございました。本利用規約をご理解いただき、また、本利用規約の遵守をご同意いただくことにより、すべてのユーザーの皆様に更に素晴らしい体験をしていただくことができるものと思います。それでは{{data.remote.settings.platform[data.language]}}サービスをお楽しみ下さい！\r\n','