verability.\r\n\r\nPlease note that these Terms of Use, including {{data.remote.settings.platform[data.language]}}’s Privacy Policy which is incorporated in these Terms and any end user license agreement that might accompany {{data.remote.settings.platform[data.language]}} authorized applications, features and devices, constitute the entire legal agreement between you and {{data.remote.settings.platform[data.language]}} and govern your use of the {{data.remote.settings.platform[data.language]}} Services (including your use of the Content) (but excludes any services, if any, that {{data.remote.settings.platform[data.language]}} may provide to you under a separate signed written agreement), and completely replaces any prior agreements between you and {{data.remote.settings.platform[data.language]}} in relation to the {{data.remote.settings.platform[data.language]}} Services. Except as set forth in Section 2 above, these Terms may not be amended or varied except in a writing signed by {{data.remote.settings.platform[data.language]}}. Although we understand that electronic or digital signatures are frequently viewed as the equivalent of traditional written signatures these days, for these purposes, a signature or “signed” writing or written agreement may not include an electronic or digital signature. These Terms of Use operate to the fullest extent permissible by law. If any provision of these Terms is held to be unlawful, void, or unenforceable, you and we agree that the provision will be deemed severable from these Terms and will not affect the validity and enforceability of any remaining provisions.\r\n\r\nContact Information.\r\n\r\nIf you have any questions or comments about these Terms, or if you have questions pertaining to your subscription, please contact our customer service department at the contact information listed below.\r\n\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}}\r\n{{data.remote.settings.our_tel[data.remote.country.code]}}\r\n\r\nThank you for taking the time to read these Terms of Use. By understanding and agreeing to follow these Terms, the experience will be better for all users. Enjoy the {{data.remote.settings.platform[data.language]}} Services!\r\n'),(76,'global','global','excluding_tax','税抜','excluding consumption tax'),(77,'act','index','act_content','事業者名\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n\r\n住所\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}}\r\n\r\n連絡先\r\n(TEL) \r\n{{data.remote.settings.our_tel[data.remote.country.code]}}\r\n(E-mail) {{data.remote.settings.support_email}}\r\n\r\n代表者\r\n{{data.remote.settings.our_representative[data.remote.country.code][data.language]}}','Business operator\r\n{{data.remote.settings.our_name[data.remote.country.code][data.language]}}\r\n\r\nAddress\r\n{{data.remote.settings.our_address[data.remote.country.code][data.language]}} \r\n\r\nContact\r\n(TEL) {{data.remote.settings.our_tel[data.remote.country.code]}}\r\n(E-mail) {{data.remote.settings.support_email}}\r\n\r\nRepresentative\r\n{{data.remote.settings.our_representative[data.remote.country.code][data.language]}}\r\n'),(78,'act','index','service_usage_fee','{{data.remote.settings.platform[data.language]}}サービスご利用に必要な料金などについて','{{data.remote.settings.platform[data.language]}} service usage fee'),(79,'act','index','service_usage_fee_content','{{data.remote.settings.platform[data.language]}}サービスは月額課金制の電子情報仲介サービスです。\r\n月額利用料金：1000pt\r\n1000pt: {{data.remote.settings.pt_prices[\'1000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n3000pt: {{data.remote.settings.pt_prices[\'3000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n6000pt: {{data.remote.settings.pt_prices[\'6000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n12000pt: {{data.remote.settings.pt_prices[\'12000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）','{{data.remote.settings.platform[data.language]}} is an portal service with fixed monthly charge.\r\nMonthly fee: 1000pt\r\n1000pt: {{data.remote.settings.pt_prices[\'1000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n3000pt: {{data.remote.settings.pt_prices[\'3000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n6000pt: {{data.remote.settings.pt_prices[\'6000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）\r\n12000pt: {{data.remote.settings.pt_prices[\'12000\'][data.remote.country.code][data.language]}}（{{data.remote.texts.excluding_tax}}）'),(80,'act','index','any_other_cost_than_the_service_fee_to_be_borne_by_users','サービスの対価以外でお客様に発生する金銭','Any other cost than the service fee to be borne by users'),(81,'act','index','any_other_cost_than_the_service_fee_to_be_borne_by_users_content','●PC、TV、ゲーム機、STBを利用する場合\r\n\r\nPC、TV、ゲーム機、STBでインターネットをするために必要となる通信料、プロバイダ料金、その他インターネット利用のために必要となる料金\r\n\r\n\r\n●モバイル機器を利用する場合\r\n\r\n電話回線を利用してストリーミングする際に発生するパケット通信料(発生するパケット通信料の料金は、お客様の契約形態により異なります)','* When a PC, TV, Game Console or STB is used \r\n\r\nCommunication fee for internet access on PC, TV, Game Console or STB, provider fee, and any other cost necessary to use internet.\r\n\r\n\r\n* When a mobile device is used \r\n\r\nPacket communication fee for streaming over a phone line (actual fee amount depends on user’s contract format for the packet communication.)'),(82,'act','index','payment_timing_and_method','支払い時期・支払い方法','Payment timing and method'),(83,'act','index','payment_timing_and_method_content','お支払い方法はクレジットカード、PayPalとなります(以下「お支払い方法」という)。ご利用いただけるお支払い方法は、ご使用になる機器により異なります。ご利用いただけるクレジットカードは、Visa, Master Card, JCB, American Expressとなります。\r\n\r\n月額利用料金は, 無料トライアル期間が終了した翌日に初めてのご請求が発生し、そちらの日付で毎月ポイントの引き落としにて請求いたします。請求日が請求月にない場合、該当月の最終日に請求いたします(例: 初回のご請求日が3月31日の場合、次回請求日が4月30日となります)。 なお、お客様のお支払いの時期は、お客様とクレジットカード会社等との会員規約に基づきます。','We accept payments by credit card, PayPal (each, a “payment method”). Please note that certain payment methods are only available on specific devices. We accept credit cards issued by Visa, Master Card, JCB, and American Express.\r\n\r\nThe fixed monthly fee will be paid by your Points on the same day each month, beginning on the day after your free trial ends. In the event your subscription began on a day not contained in a given month, we will charge your payment method on the last day of such month. For example, if you became a paying subscriber on March 31, your Points would next be charged on April 30. Please note that your payment method payment due date is determined by the terms of use of credit card company or other payment method you choose.'),(84,'act','index','timing_of_start_of_the_service','提供時期','Timing of start of the service'),(85,'act','index','timing_of_start_of_the_service_content','ポイントによるお支払いが完了し次第、すぐにご利用いただけます。','Subscription starts upon successful completion of your payment by using your Points.'),(86,'act','index','cancellation_of_subscription','{{data.remote.settings.platform[data.language]}}サービスのキャンセルについて','Cancellation of {{data.remote.settings.platform[data.language]}} subscription'),(87,'act','index','cancellation_of_subscription_content','お客様のアカウントページにて、「登録をキャンセル」オプションを選択することにより、お客様のアカウントをキャンセルすることができます。キャンセル後も月次の更新日（初回の課金日と同一の暦日）の前日までは継続して{{data.remote.settings.platform[data.language]}}サービスの全ての機能を利用することができます。','You may cancel your subscription by selecting the option \"cancel subscription\" on your account page. After selecting this option, you can still enjoy the subscription service until the end of your billing cycle (i.e. until one day prior to the same calendar day of the month as the first bill due date).'),(88,'act','index','system_requirements','動作環境','System requirements'),(89,'act','index','system_requirements_content','対応機器の動作環境は